        //         "Authorization": 'JWT ' + that.props.abc.token,
        //         "Content-Type": "application/json"
        //     },
        //     body: new FormData(formElem),
        // }).then(
        //     function (response) {
        //         if (response.status !== 201) {
        //             console.log('Looks like there was a problem. Status Code: ' +
        //                 response.status);
        //         }
        //         return response.json();
        //     })
        //     // Examine the text in the response  
        //     .then(function (data) {
        //         debugger
        //         that.props.dispatch(counterButton_create(data));
        //         let linkBtn = document.getElementById('disabledlink');
        //         linkBtn.classList.remove('disabled-link');
        //         linkBtn.click()
        //         console.log(data);
        //     })
        //     .catch(function (err) {
        //         console.log('Fetch Error :-S', err);
        //     });

    }

    render() {
        return (
            <div className="forform" >
                <div className="textUndrerJT"><span>Регистрация</span></div>
                <div className="div-centr-flex" >
                    <form onSubmit={this.nextPage.bind(this)} id="regJyr" className="">
                        <input name="last_name" required className="button-my button-big-my button-gray"
                            placeholder="Фамилия" />
                        <input name="first_name" placeholder="Имя" required className="button-my button-big-my button-gray" />
                        <input name="patronymic" placeholder="Отчество" required className="button-my button-big-my button-gray" />
                        <div className="textUndrerJT">
                            <span>Данные юридического лица</span>
                        </div>
                        <input name="name" placeholder="Полное наименование" required
                            className="button-my button-big-my button-gray" />
                        <input name="unp" placeholder="УНП" required className="button-my button-big-my button-gray" />
                        <div className="div-space-around ">
                            <div className='mr-25px'>
                                <span>Работаем:</span>
                            </div>
                            <div className='mr-25px'>
                                <input  type="radio" name='tax' id="without_tax" /><label htmlFor="without_tax">без НДС</label>
                            </div>
                            <div >
                                <input  type="radio" name='tax' id="with_tax" checked /><label htmlFor="with_tax">с НДС</label>
                            </div>
                        </div>
                    </form>
                </div>

                <div>
                    <div className="div-row-my">
                        <Link to={{ pathname: 'regOne' }} className="colorWhite button-my button-small-my button-red marg-1" >Назад</Link>
                       <button className="button-my button-small-my button-red marg-1" form="regJyr" type="submit">Далее</button>
                    </div>
                </div>
            </div>
        )
    }
}
const mapStateToProps = function (state) {
    return {
        // из раздела Redux с именем counter свойство cnt будет доступно
        // данному компоненту как this.props.cnt
        store: state.store,
        drivers: state.store.drivers,
    };
};

export default connect(mapStateToProps)(RegJyrMid);
